import collections
from typing import List, Dict, Callable, OrderedDict


class Solution:
    def isPossibleDivide(self, nums: List[int], k: int) -> bool:
        nums.sort()
        i, j, n = -1, 0, len(nums)
        cnt = collections.OrderedDict()
        for v in nums:
            cnt[v] = 1 + (cnt[v] if v in cnt else 0)
        while cnt:
            v = list(cnt.keys())[0]
            for i in range(k):
                if v + i not in cnt:
                    return False
                cnt[v + i] -= 1
                if cnt[v + i] == 0:
                    cnt.pop(v + i)
        return True

